    constructor(){
    	super();
    	this.state = {
    		robots:robots,
	        searchfield:''
    	}
    }
	render() {
	  return (
	<div className="tc">
	<h1> Robofriends </h1>
	<SearchBox />
	<CardList robots={ robots }/>
    </div>
 );	
	}

}


export default App;
